/* istanbul ignore file */
/* tslint:disable */
/* eslint-disable */

/**
 * An enumeration.
 */
export enum JobType {
    DETECTION = 'detection',
    CHANGE_DETECTION = 'change_detection',
    SEGMENTATION = 'segmentation',
}
